text:
This reeks of a cover-up. 

@michaelgove you have spent three years doing Putin's bidding by trying to break up the EU, played a leading role in the law-breaking 2016 campaign, and now you are sitting on the report into Russian electoral interference.

What are you hiding?

This government just doesn't care and it breaks my heart. 

@UKLabour will have a stand alone Women and Equalities department. Supporting women will be central to everything we do. 

Its time for a change of government vote @UKLabour on Thursday.

And a huge thank you to my fantastic constituency team past and present, who have always been so supportive and committed to our work in #Warrington North.

@DomBres @andrewhill1993 @Morgan_Tarr @AlisonLOrlandi 
@_calamityjade_ @SteveGilmore17 @lotts (and our much missed Steve)

The PM @BorisJohnson has announced he has reached an EU deal with the EU Commission!
My constituents overwhelmingly want to get Brexit done and I have long sought this to be achieved with an agreed deal.
@HouseofCommons about to debate sitting this Saturday to vote on it.
